import { Row, Col} from 'reactstrap';


export default function Home () {
    return (
        <div className="Home">
            <div className="Row">
                <div className="Col" xl="8">
                    col-8
                </div>
                <div className="Col" xl="4">
                    col-4
                </div>
            </div>
        </div>
    );
}
